import { useContext } from 'react';
import { FaLaptop, FaTabletAlt, FaMobileAlt } from 'react-icons/fa';

const Header = ({ title}) => {
  const {width} = useContext()
  return (
    <header className='Header'>
      <h2>{title}</h2>
      {width < 768 ? <FaMobileAlt /> 
        : width < 992 ? <FaTabletAlt /> 
          : <FaLaptop />}
    </header>
  );
}

export default Header;
